import React, { useState } from 'react';
import axios from 'axios';
import { Box, Button, Container, TextField, Typography, Paper, CircularProgress, Alert } from '@mui/material';

// Stub AuthProvider and Descope components
const AuthProvider: React.FC<{ projectId: string; children?: React.ReactNode }> = ({ children }) => <>{children}</>;
const Descope: React.FC<{
  flowId: string;
  theme?: string;
  onSuccess?: (e: any) => void;
  onError?: (e: any) => void;
}> = ({ onSuccess }) => (
  <Box textAlign="center" p={3} border={1} borderColor="grey.300" borderRadius={2} bgcolor="background.paper">
    <Typography variant="h6" mb={2}>Login (Stub)</Typography>
    <Button variant="contained" color="primary" onClick={() => onSuccess && onSuccess({ detail: { user: { email: 'testuser@example.com', name: 'Test User' }, session: { token: 'fake-session-token' } } })}>
      Sign In
    </Button>
  </Box>
);

export default function HelpSharingAgent() {
  const [user, setUser] = useState<{ email: string; name?: string } | null>(null);
  const [sessionToken, setSessionToken] = useState<string | null>(null);
  const [message, setMessage] = useState('');
  const [dateTime, setDateTime] = useState('');
  const [loading, setLoading] = useState(false);
  const [alert, setAlert] = useState<{ severity: 'success' | 'error'; message: string } | null>(null);

  async function createEvent() {
    if (!user || !sessionToken) {
      setAlert({ severity: 'error', message: 'Please log in first' });
      return;
    }
    if (!message.trim() || !dateTime) {
      setAlert({ severity: 'error', message: 'Please enter a message and date/time' });
      return;
    }
    setLoading(true);
    setAlert(null);
    try {
      const event = {
        summary: 'Neighborhood Help Request',
        description: message.trim(),
        start: { dateTime: new Date(dateTime).toISOString(), timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone },
        end: { dateTime: new Date(new Date(dateTime).getTime() + 30 * 60000).toISOString(), timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone },
        reminders: { useDefault: true },
      };
      const response = await axios.post(
        '/api/create-event',
        { event, email: user.email },
        { headers: { Authorization: `Bearer ${sessionToken}` } }
      );
      setAlert({ severity: 'success', message: `Event created: ${response.data.summary} at ${new Date(response.data.start.dateTime).toLocaleString()}` });
      setMessage('');
      setDateTime('');
    } catch (err) {
      setAlert({ severity: 'error', message: 'Failed to create event. Please try again.' });
      console.error(err);
    } finally {
      setLoading(false);
    }
  }

  return (
    <AuthProvider projectId="P321NcYgY3z0ACnbCyQyA3rWmY3V">
      <Container maxWidth="sm" sx={{ mt: 8 }}>
        <Paper elevation={3} sx={{ p: 4 }}>
          <Typography variant="h4" align="center" color="primary" gutterBottom>
            Neighborhood Help Coordinator
          </Typography>
          <Typography variant="body1" align="center" color="textSecondary" gutterBottom>
            Connect with neighbors & share support easily
          </Typography>

          {!user ? (
            <Descope
              flowId="help-agent-flow"
              theme="light"
              onSuccess={(e: any) => {
                setUser(e.detail.user);
                setSessionToken(e.detail.session.token);
                setAlert(null);
              }}
              onError={(err: any) => {
                setAlert({ severity: 'error', message: 'Authentication error. Please try again.' });
                console.error('Descope error:', err);
              }}
            />
          ) : (
            <>
              {alert && (
                <Alert severity={alert.severity} sx={{ mb: 2 }}>
                  {alert.message}
                </Alert>
              )}
              <Typography variant="h6" mb={2}>
                Welcome, <strong>{user.name || user.email}</strong>! Youâ€™re signed in.
              </Typography>

              <TextField
                label="Help Request / Offer"
                multiline
                rows={4}
                fullWidth
                value={message}
                onChange={(e) => setMessage(e.target.value)}
                margin="normal"
                variant="outlined"
              />

              <TextField
                label="Date and Time"
                type="datetime-local"
                fullWidth
                value={dateTime}
                onChange={(e) => setDateTime(e.target.value)}
                margin="normal"
                InputLabelProps={{
                  shrink: true,
                }}
              />

              <Button
                variant="contained"
                color="primary"
                fullWidth
                size="large"
                disabled={loading}
                onClick={createEvent}
                sx={{ mt: 2 }}
              >
                {loading ? <CircularProgress size={24} /> : 'Create Help Event'}
              </Button>

              <Button
                variant="outlined"
                color="error"
                fullWidth
                size="large"
                onClick={() => {
                  setUser(null);
                  setSessionToken(null);
                  setMessage('');
                  setDateTime('');
                  setAlert(null);
                }}
                sx={{ mt: 2 }}
              >
                Sign out
              </Button>
            </>
          )}
        </Paper>
      </Container>
    </AuthProvider>
  );
}
